];


performanceIds = [
  "660db8847529970040f12538"
];


allIds = [
  ...enrollmentIds,
  ...performanceIds,
]


widget.tabs = [
  {
    title: "Activity",
    displayWidgetIds: enrollmentIds,
    hideWidgetIds: allIds.filter(n => !enrollmentIds.includes(n)),
  },

  {
    title: "Performance",
    displayWidgetIds: performanceIds,
    hideWidgetIds: allIds.filter(n => !performanceIds.includes(n)),
  },

];

